package br.com.javaparaweb.financeiro.util;

public class RNException extends Exception {
	public RNException() {
		// TODO Auto-generated constructor stub
	}
	
	public RNException(String message) {
		super(message);
	}
	
	public RNException(Throwable cause) {
		super(cause);
	}
	
	public RNException(String message, Throwable cause, boolean enableSuppression, boolean writebleStackTrace) {
		super(message, cause, enableSuppression, writebleStackTrace);
	}
	
}
